import React from "react";
import Carde from "../component/Card";
import Slider from "../component/Slider";
import productlist from "../products.json"

const Home = () => {
  
    return (
        <>
            <Slider />
            <br />
            <h1 className=" container text-center">Trending Products</h1>
            <br />
            {productlist.map((product , i)=>{
                 console.log(product.imgsc);
            return <Carde imgsrc={product.imgsc.toString()} title={product.title.toString()} description={product.description.toString()} />
               
            }
        )}
  
        </>
    )
}

export default Home;
